import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
    return (
        <div>
            <ExpenseItem date={props.date[0].date} title={props.title[0].title} amount={props.amount[0].amount} />
            <ExpenseItem date={props.date[1].date} title={props.title[1].title} amount={props.amount[1].amount} />
            <ExpenseItem date={props.date[2].date} title={props.title[2].title} amount={props.amount[2].amount} />
            <ExpenseItem date={props.date[3].date} title={props.title[3].title} amount={props.amount[3].amount} />
        </div>
    );
}
export default Expenses;
